      var EmbeddedHttpRequest = function () {
        this.responseType = "text";
      };
      EmbeddedHttpRequest.prototype.open = function (method, url, pass) {
        this.url = url;
      };
      EmbeddedHttpRequest.prototype.send = function (pass) {
        if (!EMBEDDED_DATA[this.url]) {
          this.onerror();
        } else {
          this.readyState = 4;
          this.status = 200;
          if (this.responseType == "text" || this.responseType == "json") {
            this.response = pako.inflate(atob(EMBEDDED_DATA[this.url]), { to: "string" });
            this.onload();
          } else {
            var data = pako.inflate(atob(EMBEDDED_DATA[this.url]));
            this.onprogress({
              lengthComputable: true,
              total: data.length,
              loaded: data.length,
            });
            this.response = data;
            this.onload();
          }
        }
      };

      EngineLoader.load("canvas", "playable_ad_example");
